import React,{Fragment} from "react";
import styles from "./Header.module.css"


const Header=()=>{
    return
    <Fragment>
        <header>
            <h2>First Food</h2>
            <button>Cart</button>
        </header>
        <div></div>
    </Fragment>
}
export default Header;
